import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import '../styles/emotionDiary.css';

function EmotionsDiary() {
  const navigate = useNavigate();
  const [results, setResults] = useState([]);
  // ratings: objeto que mapea el _id de cada resultado con la evaluaci√≥n (1 a 5)
  const [ratings, setRatings] = useState({});
  const token = localStorage.getItem('token');

  // Si no hay token, redirige al login
  useEffect(() => {
    if (!token) {
      navigate('/');
    }
  }, [token, navigate]);

  // Cargar resultados de la M√°quina del Tiempo (diario)
  useEffect(() => {
    axios.get('http://localhost:5000/api/game', {
      headers: { 'x-auth-token': token }
    })
      .then(res => setResults(res.data))
      .catch(err => console.error('Error al cargar resultados:', err));
  }, [token]);

  const handleRatingClick = (resultId, level) => {
    setRatings(prev => ({ ...prev, [resultId]: level }));
  };

  const handleSubmitRating = (resultId) => {
    const rating = ratings[resultId];
    if (!rating) {
      alert('Por favor, selecciona tu emoci√≥n para esta entrada.');
      return;
    }
    const payload = {
      timeMachineResult: resultId,
      rating: rating
    };
    axios.post('http://localhost:5000/api/emotion', payload, {
      headers: { 'x-auth-token': token }
    })
      .then(() => alert('Evaluaci√≥n guardada para esta entrada.'))
      .catch(err => {
        console.error('Error al guardar la evaluaci√≥n:', err);
        alert('Error al guardar la evaluaci√≥n.');
      });
  };

  // Definimos los 5 niveles de emoci√≥n con √≠conos (puedes ajustarlos)
  const emotionLevels = [
    { level: 1, label: 'Nada feliz', icon: 'üòû' },
    { level: 2, label: 'Poco feliz', icon: 'üôÅ' },
    { level: 3, label: 'Neutral', icon: 'üòê' },
    { level: 4, label: 'Feliz', icon: 'üôÇ' },
    { level: 5, label: 'Muy feliz', icon: 'üòÉ' }
  ];

  return (
    <div className="diario-emociones-container">
      <header className="de-header">
        <button className="back-btn" onClick={() => navigate('/dashboard')}>‚Üê</button>
        <h1>Diario de Emociones</h1>
      </header>

      <div className="de-instructions">
        <p>¬øC√≥mo te sientes con lo bien que haces estas actividades?</p>
      </div>

      <div className="de-results-container">
        {results.length === 0 ? (
          <p>No hay entradas registradas a√∫n.</p>
        ) : (
          results.map(result => (
            <div key={result._id} className="de-card">
              <div className="de-card-header">
                <h2>{result.day}</h2>
              </div>
              <div className="de-activities">
                {result.timeSlots && result.timeSlots.map(slot => (
                  <div key={slot.slot} className="de-slot">
                    <span className="de-slot-label">{slot.slot}</span>
                    <div className="de-activity-icons">
                      {slot.activities.map((act, idx) => (
                        <span key={idx} title={act.title} className="de-activity-icon">
                          {act.icon}
                        </span>
                      ))}
                    </div>
                  </div>
                ))}
              </div>
              <div className="de-emotion">
                <p>Selecciona tu emoci√≥n:</p>
                <div className="de-emotion-levels">
                  {emotionLevels.map(level => (
                    <button
                      key={level.level}
                      className={`de-emotion-btn ${ratings[result._id] === level.level ? 'selected' : ''}`}
                      onClick={() => handleRatingClick(result._id, level.level)}
                    >
                      <span role="img" aria-label={level.label}>{level.icon}</span>
                    </button>
                  ))}
                </div>
              </div>
              <button className="de-submit-btn" onClick={() => handleSubmitRating(result._id)}>
                Guardar Evaluaci√≥n
              </button>
            </div>
          ))
        )}
      </div>

      <footer className="de-footer">
        <p>2025 ¬© Iv√°n Vela Campos</p>
      </footer>
    </div>
  );
}

export default EmotionsDiary;
